Considerando as múltiplas demandas que recaem sobre esta Casa Legislativa, tanto no âmbito de suas atividades legislativas quanto administrativas, além do atendimento contínuo ao público durante todos os dias úteis da semana;
Considerando a necessidade de adequação às disposições constantes na Lei nº 14.133/2021 – Nova Lei de Licitações e Contratos Administrativos – especialmente no que tange à implementação gradual de seus dispositivos e à complexidade técnica envolvida nesse processo;
Considerando o quadro reduzido de servidores administrativos, o que tem inviabilizado a elaboração e o lançamento tempestivo das informações requeridas no prazo originalmente estipulado pelo Decreto Municipal nº 3.884/2024, em especial no que dispõe o art. 21;
Considerando o processo de implementação da Nova Lei de Licitações e Contratos Administrativos (Lei nº 14.133/2021), o qual tem ensejado o surgimento de novas demandas ao longo do exercício, notadamente aquelas não contempladas originalmente no Plano de Contratações Anual (PCA), impõe-se a necessidade de ajustes e adequações para o atendimento eficiente e legal das exigências administrativas;
Diante de tais circunstâncias, impõe-se a necessidade de prorrogação do prazo estabelecido no referido decreto municipal, a fim de viabilizar que todos os setores desta Casa possam apresentar, de forma adequada, suas respectivas demandas relativas à contratação de bens e serviços, observando os princípios da legalidade, eficiência e planejamento.
Ressalta-se que o planejamento, enquanto instrumento de gestão pública, é essencial para o diagnóstico de necessidades, definição de metas e objetivos e para a condução eficiente dos processos administrativos, conferindo maior celeridade, economicidade e alinhamento com o interesse público nas futuras contratações.
Nestes termos, solicita-se a prorrogação do prazo previsto no art. 21 do Decreto Municipal nº 3.884/2024, de forma a permitir o pleno atendimento das exigências legais e a consolidação de um planejamento estratégico eficaz no âmbito
